import React, {Component} from 'react';
import Detail from "./Detail/Detail";

class News extends Component {
    state={
        news_array:[
            {id:"01",title:"这是标题1"},
            {id:"02",title:"这是标题2"},
            {id:"03",title:"这是标题3"},
            {id:"04",title:"这是标题4"}
        ]
    }
    render() {
        return (
            <div >
                {
                    this.state.news_array.map((NewsObj)=>{
                        return <li className="News_content" key={NewsObj.id}>
                            <Detail/>id:{NewsObj.id},{NewsObj.title}
                        </li>
                    })
                }
            </div>
        );
    }
}

export default News;
